description:
Vishwamitra Sharma, &quot;Famous Indians of the 21st Century&quot;
ISBN: 8122308295 | 2007 | EPUB | 273 pages | 3 MB

For people of all age-groups, reading about the lives and times of great Indians is always inspiring and uplifting. For those looking for success and purpose in their lives can greatly benefit from this masterly work! This book presents insights on more than 100 famous Indians of the 20th century.
